import React from 'react'
import styled from 'styled-components'
import HotelDetail from './HotelDetail'

function HotelList() {
  return (
    <HotelListDisplay>
      <HotelDetail/>
    </HotelListDisplay>
  )
}

export default HotelList

const HotelListDisplay = styled.div`
display:flex;
justify-content:space-evenly;
width:50%;
`
